import { useLocation } from 'react-router-dom';
function Profile(){

    const location = useLocation();

    const firstname = location.state.data;



    return(
        <div>
            <h1>
           Welcome {firstname}!
        </h1>

        <div>Add book review</div>

        </div>
    );
}

export default Profile;
